    const handleClick = (e) => {
        console.log("Hello ninjas", e);
    }

    const handleClickWithArg = (name, e) =>{
        console.log("hello " + name, e.target);
    }

    return ( 
        <div className="home" style={{
            fontSize: "30px",
            marginBottom: "10px"
        }}>HOME Component!
        <button onClick={handleClick}>Click me</button>
        <button onClick={(e) => handleClickWithArg("mario", e.target)}>Click me again</button>
        </div>
    );
}

export default Home;
